import React from 'react';
import Edu1 from './Edu1';

import Edu2 from './Edu2';
import Edu2Back from './Edu2Back';
import Edu3 from './Edu3';
import Edu3Back from './Edu3Back';

import './Education.css';

class Education extends React.Component {


    render() {
        return (
            <div 
                className='education-page'
                style={{
                    display: 'flex',
                    flexDirection: 'row',
                    flexWrap: 'wrap',
                    alignContent: 'center',
                    justifyContent: 'center',
                }}
            >
                    <Edu1 
                        toggleBack={this.toggleBack} 
                        handleClick={this.handleClick}
                    />
                    <Edu2 />
                    <Edu2Back />
                    <Edu3 />
                    <Edu3Back />
            </div>
        )
    }
}

export default Education;
